import React from "react";
const ContactUs = () =>{
    return(
        <div className="w-full text-white py-16">
            <div className="max-w-[1240px] mx-auto grid lg:grid-cols-2">
                <div >
                <h1 className="md:text-5xl uppercase font-serif text-3xl ">Get In Touch</h1>
                </div>
                <div className="my-6">
                <h1>Form</h1>
                <div>
                    <input className="p-3 rounded-md w-full" type="text" placeholder="Enter Your Name" />
                </div>
                </div>
            </div>
           
        </div>
    )
}
export default ContactUs;
